INSERT INTO app_artist VALUES(1,'Taylor Alison Swift (nascida em 13 de dezembro de 1989) é uma cantora e compositora americana. Conhecida por suas composições biográficas, reinvenções artísticas e impacto cultural, Swift é uma figura importante na música popular e objeto de amplo interesse público.','artists/taylorswift_mmz4nKO.jpg','Taylor Swift','background_images/taylor_psku8SY_VS2vzs7.jpeg');
INSERT INTO app_artist VALUES(2,'Kendrick Lamar Duckworth (Compton, 17 de junho de 1987) é um rapper, compositor e produtor musical norte-americano. Vencedor de 17 prêmios Grammy, é um dos dois únicos músicos fora da música clássica a receber o Prémio Pulitzer, sendo considerado como um dos artistas mais influentes de sua geração, além de um dos maiores rappers e letristas de todos os tempos.','artists/kendricklamar_UaM2R3S.jpg','Kendrick Lamar','background_images/kendrick_background_WZiq14x_W6OCL4J.jpeg');
INSERT INTO app_artist VALUES(3,'The Beatles foi uma banda de rock britânica, formada na cidade de Liverpool em 1960. Com os integrantes John Lennon, Paul McCartney, George Harrison e Ringo Starr, o grupo tornou-se altamente reconhecido como o melhor e mais bem sucedido da era do rock. Enraizados no skiffle, beat e o rock and roll dos anos 1950, os Beatles mais tarde experimentaram com diversos gêneros, desde baladas pop e a música indiana até a música psicodélica e o hard rock, e incorporaram elementos clássicos de maneiras inovadoras. Em meados da década de 1960, a imensa popularidade da banda tornou-se conhecida como a "Beatlemania", mas conforme a música do grupo crescia em sofisticação, liderada pelos principais compositores Lennon e McCartney, seus membros começaram a ser percebidos como uma incorporação dos ideais compartilhados pelas revoluções socioculturais da era.','artists/thebeatles_1OxJmwL.jpg','The Beatles','background_images/beatles_wPTn4j5_ijdFzr4.jpeg');
INSERT INTO app_artist VALUES(4,'Led Zeppelin foi uma banda britânica de rock formada em Londres, em 1968. Consistia no guitarrista Jimmy Page, no vocalista Robert Plant, no baixista e tecladista John Paul Jones e no baterista John Bonham. Seu som pesado e violento de guitarra, enraizado no blues e música psicodélica de seus dois primeiros álbuns, é frequentemente reconhecido como um dos fundadores do heavy metal. Seu estilo foi inspirado em uma grande variedade de influências, incluindo a música folk, psicodélica e o blues.','artists/ledzeppelin_LvA48yp.jpg','Led Zeppelin','background_images/backzepling.jpg');
INSERT INTO app_artist VALUES(5,'Cantora, compositora e atriz norte-americana, conhecida por suas performances e influência na cultura pop.','beyonce.jpg','Beyoncé','background_images/backbe_MNPs6sq.jpg');
