PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_clothing" ("product_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "color" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_cartitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "cart_id" integer NOT NULL REFERENCES "app_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "size_id" bigint NULL REFERENCES "app_size" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_size" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size" varchar(50) NOT NULL, "stock" integer NOT NULL, "clothing_id" integer NOT NULL REFERENCES "app_clothing" ("product_ptr_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_accessory" ("product_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "material" varchar(50) NOT NULL, "color" varchar(50) NOT NULL, "size" varchar(50) NOT NULL, "stock" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_cd" ("product_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "genre" varchar(50) NOT NULL, "releaseDate" date NOT NULL, "stock" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_vinil" ("product_ptr_id" integer NOT NULL PRIMARY KEY REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "genre" varchar(50) NOT NULL, "lpSize" varchar(5) NOT NULL, "releaseDate" date NOT NULL, "stock" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_artist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "description" text NOT NULL, "image" varchar(100) NOT NULL, "name" varchar(50) NOT NULL UNIQUE, "background_image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "app_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "date" date NOT NULL);
CREATE TABLE IF NOT EXISTS "app_company" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "address" varchar(50) NULL, "email" varchar(50) NOT NULL UNIQUE, "phone" varchar(50) NULL, "logo" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "app_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(150) NOT NULL UNIQUE, "email" varchar(50) NULL UNIQUE, "number_of_purchases" integer NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL, "last_login" datetime NULL, "last_name" varchar(150) NOT NULL, "address" varchar(50) NULL, "country" varchar(50) NULL, "phone" varchar(50) NOT NULL UNIQUE, "image" varchar(100) NULL, "company_id" bigint NULL REFERENCES "app_company" ("id") DEFERRABLE INITIALLY DEFERRED, "user_type" varchar(10) NOT NULL, "firstname" varchar(50) NULL, "lastname" varchar(50) NULL, "password" varchar(128) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_purchaseproduct" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "product_id" integer NOT NULL REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "purchase_id" integer NOT NULL REFERENCES "app_purchase" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_favorite" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" integer NOT NULL REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "description" text NOT NULL, "price" real NULL, "image" varchar(100) NOT NULL, "category" varchar(50) NOT NULL, "artist_id" integer NULL REFERENCES "app_artist" ("id") DEFERRABLE INITIALLY DEFERRED, "company_id" bigint NULL REFERENCES "app_company" ("id") DEFERRABLE INITIALLY DEFERRED, "count" integer NOT NULL, "addedProduct" date NULL);
CREATE TABLE IF NOT EXISTS "app_favoriteartist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "artist_id" integer NULL REFERENCES "app_artist" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_favoritecompany" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "company_id" bigint NULL REFERENCES "app_company" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_purchase" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" date NOT NULL, "paymentMethod" varchar(50) NOT NULL, "shippingAddress" varchar(50) NOT NULL, "status" varchar(50) NOT NULL, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "total_amount" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "app_review" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "text" text NULL, "date" datetime NOT NULL, "product_id" integer NOT NULL REFERENCES "app_product" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "rating" integer NULL);
